import React from "react";
import ExpenseItem from "./ExpenseItem";

const ExpenseList=(props)=>{
    if (props.length > 0) {
        expenseContent = filteredExpenses.map(expense => <ExpenseItem key={expense.id} id={expense.id} title={expense.title} amount={expense.amount} date={expense.date} />)
      }
}

export default ExpenseList
